import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

function Header() {
	return (
		<ComponentsWrapper>
			<div className="MainBar_MainBar">
				<nav className="MainBar_MainBar_nav">
					<NavLogo>
						<button type="button">
							<img
								src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Ficon-menu.png&amp;w=undefined&amp;q=75"
								alt="hamberger menu"
							/>
						</button>
						<Link to="/">
							<i className="icon-logo_new" />
						</Link>
					</NavLogo>
					<MenuClassName>
						<li>
							<Link to="/jobsfeed">채용</Link>
						</li>
						<li>
							<Link to="/events">이벤트</Link>
						</li>
						<li>
							<Link to="/salary">직군별 연봉</Link>
						</li>
						<li>
							<Link to="/cv/list">이력서</Link>
						</li>
						<li>
							<Link to="/community">
								커뮤니티
								<em>
									<svg
										xmlns="http://www.w3.org/2000/svg"
										width="18"
										height="11"
										viewBox="0 0 18 11"
									>
										<g
											fill="none"
											fillRule="evenodd"
											fontFamily="AppleSDGothicNeo-SemiBold, Apple SD Gothic Neo"
											fontSize="9"
											fontWeight="500"
										>
											<g fill="#36F">
												<g>
													<g>
														<g>
															<g>
																<g>
																	<g>
																		<text transform="translate(-931.000000, -13.000000) translate(224.000000, 7.000000) translate(210.000000, 6.000000) translate(350.000000, 0.000000) translate(147.000000, 0.000000)">
																			<tspan
																				x="0"
																				y="8"
																			>
																				New
																			</tspan>
																		</text>
																	</g>
																</g>
															</g>
														</g>
													</g>
												</g>
											</g>
										</g>
									</svg>
								</em>
							</Link>
						</li>
						<li>
							<Link to="https://www.wanted.co.kr/gigs/experts">
								프리랜서
							</Link>
						</li>
						<li>
							<Link to="/aiscore/resume">
								AI 합격예측
								<span>
									<svg
										xmlns="http://www.w3.org/2000/svg"
										width="18"
										height="11"
										viewBox="0 0 18 11"
									>
										<g
											fill="none"
											fillRule="evenodd"
											fontFamily="AppleSDGothicNeo-SemiBold, Apple SD Gothic Neo"
											fontSize="9"
											fontWeight="500"
										>
											<g fill="#36F">
												<g>
													<g>
														<g>
															<g>
																<g>
																	<g>
																		<text transform="translate(-931.000000, -13.000000) translate(224.000000, 7.000000) translate(210.000000, 6.000000) translate(350.000000, 0.000000) translate(147.000000, 0.000000)">
																			<tspan
																				x="0"
																				y="8"
																			>
																				Beta
																			</tspan>
																		</text>
																	</g>
																</g>
															</g>
														</g>
													</g>
												</g>
											</g>
										</g>
									</svg>
								</span>
							</Link>
						</li>
					</MenuClassName>
					<Aside>
						<ul>
							<li>
								<button className="searchButton" type="button">
									<svg
										xmlns="https://www.w3.org/2000/svg"
										width="18"
										height="18"
										viewBox="0 0 18 18"
									>
										<defs>
											<path
												id="qt2dnsql4a"
												d="M15.727 17.273a.563.563 0 10.796-.796l-4.875-4.875-.19-.165a.563.563 0 00-.764.028 5.063 5.063 0 111.261-2.068.562.562 0 101.073.338 6.188 6.188 0 10-1.943 2.894l4.642 4.644z"
											/>
										</defs>
										<g fill="none" fillRule="evenodd">
											<use
												fill="#333"
												fillRule="nonzero"
												stroke="#333"
												strokeWidth=".3"
												xlinkHref="#qt2dnsql4a"
											/>
										</g>
									</svg>
								</button>
							</li>
							<li>
								<button className="signUpButton" type="button">
									회원가입/로그인
								</button>
							</li>
							<li
								class="mdMoreVisible leftDivision"
								data-attribute-id="gnb"
								data-gnb-kind="forEmployers"
							>
								<a class="dashboardButton" href="/dashboard">
									기업 서비스
								</a>
							</li>
						</ul>
					</Aside>
				</nav>
			</div>
		</ComponentsWrapper>
	);
}

const Aside = styled.aside``;

const NavLogo = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-between;
	button {
		margin-top: -2px;
		margin-right: 15px;
		img {
			width: 17px;
			height: 14px;
			object-fit: contain;
		}
	}
	i {
		font-family: 'Elysio Bold' !important;
		line-height: 0.7;
		font-size: 23px;
	}
	.icon-logo_new::before {
		content: 'wanted';
	}
`;

const MenuClassName = styled.ul`
	height: inherit;
	text-align: center;
	margin: 0;
	li {
		height: inherit;
		display: inline-block;
		a {
			position: relative;
			vertical-align: middle;
			font-size: 14px;
			line-height: 20px;
			font-weight: 600;
			padding: 15px;
			display: inline-block;
			em {
				position: absolute;
				top: 10px;
				right: -5px;
				pointer-events: none;
				font-style: normal;
			}
		}
		a:after {
